import React, { useState } from "react"
import { Row, Col, PageHeader, Card, Button, Input, Space, Select } from "antd"
import { useHistory } from "react-router-dom"

const { TextArea } = Input

const Component = () => {
  const { Option } = Select

  function onChange(value) {
    console.log(`selected ${value}`)
  }

  function onBlur() {
    console.log("blur")
  }

  function onFocus() {
    console.log("focus")
  }

  function onSearch(val) {
    console.log("search:", val)
  }

  return (
    <Col span={24}>
      <Space direction="vertical" size={8}>
        <Select
          showSearch
          style={{ width: 200 }}
          placeholder="Selecionar Topico"
          optionFilterProp="children"
          onChange={onChange}
          onFocus={onFocus}
          onBlur={onBlur}
          onSearch={onSearch}
          filterOption={(input, option) =>
            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
          }
        >
          <Option value="jack">Faringe</Option>
          <Option value="lucy">Laringe</Option>
          <Option value="tom">Traqueia</Option>
        </Select>
      </Space>
      <TextArea rows={4} />
    </Col>
  )
}

const Laudo = () => {
  const navigation = useHistory()
  const [component, setComponent] = useState([])

  return (
    <Row span={24}>
      <PageHeader onBack={() => window.history.back()} title="Emitir Laudo" />
      <Col span={24}>
        <Card
          title="Tópicos"
          extra={
            <Button onClick={() => setComponent(component + 1)}>
              Adicionar Tópico
            </Button>
          }
        >
          {[...component].map((_, index) => (
            // eslint-disable-next-line react/no-array-index-key
            <Component key={index} />
          ))}
        </Card>
      </Col>
    </Row>
  )
}

export default Laudo
